(2473, 'wotoadgi', 'wotoadgi', 'google', 'gingivitisgrate@sina.com', '123456', 'https://www.lojistic.com/shipping-to-north-america-leif-eriksons-place-in-history', NULL, '{"hs":{"product_interest_s__c":"Contact","web_comments":"@@@ \\r\\nA few years ago, researchers proposed something called    the Grand Tack theory. The idea is that Jupiter got pulled toward the sun after its formation, caught up in the pull of interplanetary dust. When it caught up with Saturn, the two planets pulled each other back to their current positions.The researchers who came up with Grand Tack proposed that Jupiter''s slow pull through the solar system would have disturbed the position of the asteroid belt, as well as making Mars smaller than it should be by hogging and displacing    planet-building materials. The new study takes this theory a step further by calculating what would happen to the kind of planets that should be orbiting just around our sun if Jupiter made this trek.Based on their calculations, they think Jupiter could    have done those planets in. The massive gas giant would have messed with the orbits of all of the not-quite-planets forming in the life-giving dust of the early solar system. Once a couple of the unwieldy space    rocks collided, it would cause a chain reaction of destruction. And based on simulations using the dimensions of a known super-Earth, the researchers believe that any planets in Jupiter''s wake would be crushed by the onslaught of debris after just 20,000 years. It''s the same thing we worry about if satellites were to be destroyed in low-Earth orbit. Their fragments would start smashing into other satellites and you''d risk a chain reaction of    collisions. Our work indicates that Jupiter would have created just such a collisional cascade in the inner solar system, Laughlin said in a statement.From there it would have been a pretty quick trip    into the sun for total annihilation. Our own planet and its rocky neighbors would have been born from the planetary ashes of the dead giants. Jupiter''s ''Grand Tack'' may well have been a ''Grand Attack'' on the original inner solar system, Laughlin said. Copyright 2015, \\r\\n\\r\\n"},"submit":"SEND"}', '2015-09-10 19:58:38', '2015-09-10 19:58:38'),
